import styled from "styled-components";

export const Navbar = styled.nav`
    width: 100%;
    padding: 10px 50px;

    background: transparent;

    color: #F2F5F8;
`;

export const UList = styled.ul`
    display: flex;
    align-items: center;
    justify-content: center;

    gap: 10px;

    list-style: none;
`;

export const listElement = styled.li`


    border: 1px solid red;

    &:hover {
        color: #F7257D;
    }
`;
